import React, { useEffect, useContext } from "react";
import NavigBar from "./NavigBar";

const Welcome = () => {
  useEffect(() => (document.title = "Welcome"));
  return (
    <>
      <div className="mt-5 d-flex justify-content-center align-items-center">
        <h1>Welcome!</h1>
      </div>
    </>
  );
};

export default Welcome;
